import { useState } from 'react';
import style from './Header.module.css';
import { http } from '../../hooks/http.hooks';
import { Link } from 'react-router-dom';

const Header = () => {

    return (
        <header className={style['header']}>
            <h1 className={style['logo']}>Hschool</h1>

            <div className={style['header-buttons']}>

                <div className={style['nightmode']}>
                    <div className={style['switch']}></div>
                </div>
                <p className={style['contact']}>contact</p>

                <div className={style['container']}>
                    <div className={style['image']}></div>
                    <p className={style['language']}>En</p>
                </div>


                <div className={style['signup-button']}>Sign Up</div>

                <div className={style['login-button']}>Login</div>
            </div>
        </header>
    );
}

export default Header;
